import React from 'react';
import { useNavigate } from 'react-router-dom';

const Navbar = () => {
  const Navigate = useNavigate();

  const handleRedirect = (route) => {
    Navigate(route);
  };

  return (
    <nav>
      <ul>
        <li>
          <button className='nav' onClick={() => handleRedirect('/')}>Home</button>
        </li>
        <li>
          <button className='nav' onClick={() => handleRedirect('/movie')}>About</button>
        </li>
        <li>
          <button className='nav' onClick={() => handleRedirect('/contact')}>Contact</button>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;










